  var brownfield = {"local-authority-eng:STO":[{"resource-date":"2018-05-22","entry-date":"2017-12-18","organisation":"local-authority-eng:STO","site":"BR001","site-address":"Garage court rear of Marybrook Street car park, Marybrook Street Berkeley","site-plan-url":"https://stroud.maps.arcgis.com/apps/webappviewer/index.html?id=8d2cd204b79c4852b8d4365e24d16013&center=-2.4588082,51.692409&level=17","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.692418","longitude":"-2.458808","hectares":"0.08","minimum-net-dwellings":"5","maximum-net-dwellings":"5","start-date":"2017-12-18","end-date":"","notes":"Main constraints: Existing garage use.\r\nSummary: The site is considered suitable for redevelopment for housing  subject to providing adequate car parking for existing residents and future occupants. There is a reasonable prospect that the site will be available in the future and that development as envisaged will be delivered on the site within 15 years.. This site could be redeveloped for high density housing, comprising flats at an average density of about 60 dph, and the suggested yield is 5 units.","resource":"7384d83065376a4fcccb0b25c840704e1012b3467420e0a609816540bda3ad17","point":[51.692418,-2.458808],"size":0.08},{"resource-date":"2018-05-22","entry-date":"2017-12-18","organisation":"local-authority-eng:STO","site":"BR002","site-address":"Queens Court, The Bourne Brimscombe","site-plan-url":"https://stroud.maps.arcgis.com/apps/webappviewer/index.html?id=8d2cd204b79c4852b8d4365e24d16013&center=-2.1764679,51.718852&level=17","deliverable":"yes","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.718852","longitude":"-2.176453","hectares":"0.44","minimum-net-dwellings":"30","maximum-net-dwellings":"30","start-date":"2017-12-18","end-date":"","notes":"Main constraints: Demolition of existing building. \r\nSummary:  The site is considered to be deliverable for housing within five years. The site is available now and it is suitable for redevelopment for housing / community development.. This site could be redeveloped for medium-high density housing comprising flats and townhouses at an average density of 50-75dph, and the suggested yield is up to 30 units.","resource":"7384d83065376a4fcccb0b25c840704e1012b3467420e0a609816540bda3ad17","point":[51.718852,-2.176453],"size":0.44},{"resource-date":"2018-05-22","entry-date":"2017-12-18","organisation":"local-authority-eng:STO","site":"BR003","site-address":"Brimscombe Mills & Mill Pond, London Road Brimscombe","site-plan-url":"https://stroud.maps.arcgis.com/apps/webappviewer/index.html?id=8d2cd204b79c4852b8d4365e24d16013&center=-2.1942217,51.720415&level=17","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.720424","longitude":"-2.194207","hectares":"1.46","minimum-net-dwellings":"25","maximum-net-dwellings":"25","start-date":"2017-12-18","end-date":"","notes":"Main constraints: Brimscombe Mill Local Plan Site Allocations Policy SA1d; Regenerating existing employment sites Local Plan Delivery Policy EI2 (ER2), Industrial Heritage Conservation Area; flood risk, canal and site access. Site investigation required.\r\nSummary: The site is allocated in the Local Plan for mixed use redevelopment and is considered suitable for housing/ community development and employment uses. Redevelopment should involve adapting and re-using surviving historic buildings. Most of the site is within Flood Zone 3 and the site should not be developed until the adjoining Cotswold Canal has been reinstated or until a site specific Flood Risk Assessment demonstrates that the site can be safely developed, with more vulnerable development being located
